            checked:true
        }, 
        {
            id:2,
            text:'this is temp text2',
            checked:true
        },
        {
            id:3,
            text:'this is temp text',
            checked:false
        }

    ])


    return(
        <div className={`${styles.Todotemplate} `}>
            <div className={`${styles.titlen}` }> 
                Today-List
            </div>
            
            <div className={`${styles.content},`}>
               
                {children}
            </div>
            
    
        </div>
    );
}

export default Todo;
